def quiz5quiz():
    form=cgi.FieldStorage()
    HTML=Top
    points=0
    #Question 1
    if form.getvalue("show")=="nick":
        points+=1
    if form.getvalue("show")=="disney":
        points+=2
    if form.getvalue("show")=="cartoon":
        points+=3
    if form.getvalue("show")=="other":
        points+=4
    #Question 2
    if form.getvalue("sentence")=="sequence":
        points+=2
    #Question 3
    if form.getvalue("ten")=="home":
        points+=1
    if form.getvalue("ten")=="sports":
        points+=2
    if form.getvalue("ten")=="playdate":
        points+=4
    if form.getvalue("ten")=="hobby":
        points+=3
    #Question 4
    points+=random.randint(1,5)
    #Question 5
    if form.getvalue("grade", "")=="Kindergarten":
        points+=1
    if form.getvalue("grade", "")=="1st Grade":
        points+=2
    if form.getvalue("grade", "")=="2nd Grade":
        points+=3
    if form.getvalue("grade", "")=="3rd Grade":
        points+=4
    if form.getvalue("grade", "")=="4th Grade":
        points+=5
    if form.getvalue("grade", "")=="5th Grade":
        points+=6
    #Question 6
    if form.getvalue("read")=="yes":
        points+=2
    if form.getvalue("read")=="no":
        points+=4
    #Points
    if points<6:
        HTML=HTML.replace("??answer??", "Avatar The Last Airbender")
        HTML=HTML.replace("??picture??", "data:image/jpeg;base64,")
    elif points<12:
        HTML=HTML.replace("??answer??", "Phineas and Ferb")
        HTML=HTML.replace("??picture??", "data:image/jpeg;base64,")
    elif points<18:
        HTML=HTML.replace("??answer??", "Adventure Time")
        HTML=HTML.replace("??picture??", "data:image/jpeg;base64,")
    elif points>=18:
        HTML=HTML.replace("??answer??", "Spongebob")
        HTML=HTML.replace("??picture??", "data:image/jpeg;base64,")
    #Submit
    if form.getvalue("done")=="Find Out!":
        print(HTML)

quiz5quiz()
    
    
        